import {Container } from "react-bootstrap";
import Header from "./components/Header";
import React  from 'react';
import Footer from "./components/Footer";

const App = () => {
  return (
    <>
      <Header />
      <main className="py-3">
        <Container>
          <h1>Welcome to Vinyl Shop</h1>
      </Container>
      </main>
      <Footer />
    </>
  )
};

export default App
